import Dau from "./Dau";
import NDTCT from "./NoiDungChiTiet";
import Cuoi from "./cuoi";
const Member=[
    {
      IMGSP: "anh_1.jpg",
      NameSP: "SP thu 1",
      PriceSP: 50000,
    }];
  
  for (let i=1;i<8;i++){
    Member[i]={IMGSP: "anh_1.jpg",
    NameSP: "SP thu "+i,
    PriceSP: 50000,}
  }
  

function TrangChiTiet()
{
    return(
    <>
    <div class="all">
    <Dau/>
    <NDTCT/>
    
    <Cuoi/>
    </div>
</>
    )
}

export default TrangChiTiet;
